import React, { useState } from 'react';
import '../styles/Inscription.css';

function InscriptionPro() {
    const [formData, setFormData] = useState({
        nom: '',
        prenom: '',
        email: '',
        telephone: '',
        password: '',
        confirmPassword: '',
    });

    const [errors, setErrors] = useState({});
    const [successMessage, setSuccessMessage] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
        setErrors({ ...errors, [e.target.name]: '' }); // reset error on change
    };

    const validate = () => {
        const newErrors = {};
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        const phoneRegex = /^[0-9]{8,15}$/;

        if (!formData.nom.trim()) newErrors.nom = 'Le nom est requis.';
        if (!formData.prenom.trim()) newErrors.prenom = 'Le prénom est requis.';
        if (!formData.email.trim()) newErrors.email = 'L\'email est requis.';
        else if (!emailRegex.test(formData.email)) newErrors.email = 'Email invalide.';
        if (!formData.telephone.trim()) newErrors.telephone = 'Le téléphone est requis.';
        else if (!phoneRegex.test(formData.telephone)) newErrors.telephone = 'Numéro invalide.';
        if (!formData.password) newErrors.password = 'Mot de passe requis.';
        else if (formData.password.length < 6) newErrors.password = 'Min 6 caractères.';
        if (formData.password !== formData.confirmPassword)
            newErrors.confirmPassword = 'Les mots de passe ne correspondent pas.';

        setErrors(newErrors);
        return Object.keys(newErrors).length === 0;
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (validate()) {
            console.log('Données envoyées :', formData);
            setSuccessMessage('Inscription réussie !');
            // reset form
            setFormData({
                nom: '',
                prenom: '',
                email: '',
                telephone: '',
                password: '',
                confirmPassword: '',
            });
            setErrors({});
        }
    };

    return (
        <div className="form-container">
            <h2>Inscription Professionnelle</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Nom</label>
                    <input type="text" name="nom" value={formData.nom} onChange={handleChange} />
                    {errors.nom && <span className="error">{errors.nom}</span>}
                </div>

                <div className="form-group">
                    <label>Prénom</label>
                    <input type="text" name="prenom" value={formData.prenom} onChange={handleChange} />
                    {errors.prenom && <span className="error">{errors.prenom}</span>}
                </div>

                <div className="form-group">
                    <label>Email</label>
                    <input type="email" name="email" value={formData.email} onChange={handleChange} />
                    {errors.email && <span className="error">{errors.email}</span>}
                </div>

                <div className="form-group">
                    <label>Téléphone</label>
                    <input type="tel" name="telephone" value={formData.telephone} onChange={handleChange} />
                    {errors.telephone && <span className="error">{errors.telephone}</span>}
                </div>

                <div className="form-group">
                    <label>Mot de passe</label>
                    <input type="password" name="password" value={formData.password} onChange={handleChange} />
                    {errors.password && <span className="error">{errors.password}</span>}
                </div>

                <div className="form-group">
                    <label>Confirmer le mot de passe</label>
                    <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} />
                    {errors.confirmPassword && <span className="error">{errors.confirmPassword}</span>}
                </div>

                <button type="submit" className="submit-button">S'inscrire</button>
                {successMessage && <p className="success">{successMessage}</p>}
            </form>
        </div>
    );
}

export default InscriptionPro;
